import React, { useEffect, useState } from 'react';

import TextContainer from './TextContainer';

import './Chat.css';

const Chat = ({ messages }) => {
  return (
    <div className="container">
      <TextContainer
        messages={messages}
      />
    </div>
  );
};

export default Chat;
